    /** 数据库对应ID */
    private final int id;
    /** 街道/乡镇名称 */
    private final String name;

    StreetEnum(int id, String name) {
        this.id = id;
        this.name = name;
    }

    /**
     * 根据ID获取枚举
     * @param id 数据库ID
     * @return 对应的枚举，无匹配返回null
     */
    public static StreetEnum getById(int id) {
        for (StreetEnum street : values()) {
            if (street.getId() == id) {
                return street;
            }
        }
        return null;
    }

    /**
     * 根据名称获取枚举
     * @param name 街道/乡镇名称
     * @return 对应的枚举，无匹配返回null
     */
    public static StreetEnum getByName(String name) {
        for (StreetEnum street : values()) {
            if (street.getName().equals(name)) {
                return street;
            }
        }
        return null;
    }
